\[
3^7 = 2187
\]

The median of a set of 27 numbers is the 14th smallest number when the numbers are arranged in ascending order. To minimize the sum while keeping the numbers positive integers, we should make the first 13 numbers as small as possible. The smallest positive integer is 1, so we set the first 13 numbers to 1:

\[
1 + 1 + 1 + \cdots + 1 \text{ (13 times)} = 13
\]

